function formatDateTime(t){const e=new Date(t),o=e.getFullYear(),n=String(e.getMonth()+1).padStart(2,"0"),i=String(e.getDate()).padStart(2,"0"),a=String(e.getHours()).padStart(2,"0"),c=String(e.getMinutes()).padStart(2,"0"),s=String(e.getSeconds()).padStart(2,"0");return`${o}-${n}-${i} ${a}:${c}:${s}`}const plugin=(t,e)=>{const o=e.config.repo;t.beforeEach(t=>{const{file:n,path:i}=e.route;let a=e.config.lastModifiedText||"";"object"==typeof a&&Object.keys(a).some(t=>{const e=i&&i.indexOf(t)>-1;return a=e?a[t]:a,e});const c=`https://api.github.com/repos/${o}/commits?path=${n}`;return fetch(c,{method:"GET"}).then(t=>t.json()).then(t=>{const e=t[0].commit.committer.date,i=`https://github.com/${o}/commits/main/${n}`,c=formatDateTime(e),s=`\n          <blockquote>\n           <a href="${i}" target="_blank" style="color: #858585">${a+c}</a>\n           </blockquote>\n          `;document.getElementById("last-modified").innerHTML=s}),t+'<span id="last-modified"></span>'})};window.$docsify=window.$docsify||{},window.$docsify.plugins=(window.$docsify.plugins||[]).concat(plugin);